import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class Table extends Component {
  render() {
    return (
      <div className="table row">
        <div className="Header col-12">{this.props.Head}</div>

        <div className="col-12 p-0">
          <span
            className={
              this.state.showRowCondition ? "closeCard" : "closeCard toggled"
            }
            onClick={this.toggleMenu2}
          >
            <FontAwesomeIcon icon="times" size="xs" />{" "}
          </span>
          {postsRow.filter(searchFilter(search)).map(row => (
            <div
              className="rowData  col-12"
              key={row.id}
              onMouseEnter={this.showRowHighlite}
            >
              <div className="col-2">
                <div onClick={this.showRow}>{row.id}</div>
              </div>
              <div className="col-2">
                <div onClick={this.showRow}>{row.Project}</div>
              </div>
              <div className="col-2">
                <div onClick={this.showRow}>{row.Agent}</div>
              </div>
              <div className="col-2">
                <div onClick={this.showRow}>{row.Type}</div>
              </div>
            </div>
          ))}
        </div>
      </div>
    );
  }
}

export default Table;
